import ReactDOM from 'react-dom';
import App from './App';
import Card from './Cards';
import './index.css'
import Sdata from "./Sdata"

ReactDOM.render(
  <>
  <h1 className='heading_style'> Our Room 210 -The Golden Room </h1>
<Card 
imgsrc={Sdata[0].imgsrc}
title={Sdata[0].title}
sname={Sdata[0].sname}
link={Sdata[0].link}/>
